PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE amazon_competitors (
	id INTEGER NOT NULL, 
	product_id INTEGER NOT NULL, 
	search_session_id INTEGER, 
	asin TEXT NOT NULL, 
	title TEXT, 
	price FLOAT, 
	price_currency TEXT, 
	rating FLOAT, 
	review_count INTEGER, 
	bought_last_month TEXT, 
	is_prime BOOLEAN NOT NULL, 
	badge TEXT, 
	bsr_rank INTEGER, 
	bsr_category TEXT, 
	thumbnail_url TEXT, 
	amazon_url TEXT, 
	is_sponsored BOOLEAN NOT NULL, 
	position INTEGER, 
	fetched_at DATETIME NOT NULL, match_score FLOAT, reviewed BOOLEAN DEFAULT 0, brand TEXT, manufacturer TEXT, monthly_sales INTEGER, monthly_revenue FLOAT, seller TEXT, seller_country TEXT, fba_fees FLOAT, review_velocity FLOAT, fulfillment TEXT, active_sellers INTEGER, listing_created_at TEXT, seller_age_months INTEGER, buy_box_owner TEXT, size_tier TEXT, dimensions TEXT, weight FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_id) REFERENCES products (id), 
	FOREIGN KEY(search_session_id) REFERENCES search_sessions (id)
);
CREATE TABLE categories (
	id INTEGER NOT NULL, 
	name TEXT NOT NULL, 
	description TEXT, 
	parent_id INTEGER, 
	level INTEGER NOT NULL, 
	sort_order INTEGER NOT NULL, 
	amazon_department TEXT, 
	created_at DATETIME NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_category_parent_name UNIQUE (parent_id, name), 
	FOREIGN KEY(parent_id) REFERENCES categories (id) ON DELETE CASCADE
);
CREATE TABLE products (
	id INTEGER NOT NULL, 
	category_id INTEGER NOT NULL, 
	alibaba_url TEXT NOT NULL, 
	alibaba_product_id TEXT, 
	name TEXT NOT NULL, 
	name_spanish TEXT, 
	alibaba_price_min FLOAT, 
	alibaba_price_max FLOAT, 
	alibaba_price_currency TEXT, 
	alibaba_moq INTEGER, 
	alibaba_supplier TEXT, 
	alibaba_image_url TEXT, 
	alibaba_fetched_at DATETIME, 
	amazon_search_query TEXT, 
	notes TEXT, 
	created_at DATETIME NOT NULL, 
	updated_at DATETIME NOT NULL, local_image_path TEXT, status TEXT DEFAULT 'imported', decision_log TEXT DEFAULT '[]', profitability_data TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(category_id) REFERENCES "_categories_old" (id), 
	UNIQUE (alibaba_url)
);
CREATE TABLE review_analyses (
	id INTEGER NOT NULL, 
	product_id INTEGER NOT NULL, 
	asin TEXT NOT NULL, 
	competitor_title TEXT, 
	aspects_json TEXT, 
	raw_insights_json TEXT, 
	ai_synthesis TEXT, 
	product_synthesis TEXT, 
	rating FLOAT, 
	total_reviews INTEGER, 
	analyzed_at DATETIME NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_id) REFERENCES products (id)
);
CREATE TABLE search_cache (
	id INTEGER NOT NULL, 
	query_hash TEXT NOT NULL, 
	"query" TEXT NOT NULL, 
	domain TEXT NOT NULL, 
	max_pages INTEGER NOT NULL, 
	response_json TEXT NOT NULL, 
	created_at DATETIME NOT NULL, 
	expires_at DATETIME NOT NULL, 
	hit_count INTEGER NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE search_sessions (
	id INTEGER NOT NULL, 
	product_id INTEGER NOT NULL, 
	search_query TEXT NOT NULL, 
	amazon_domain TEXT, 
	total_results INTEGER, 
	organic_results INTEGER, 
	sponsored_results INTEGER, 
	avg_price FLOAT, 
	avg_rating FLOAT, 
	avg_reviews INTEGER, 
	serpapi_search_id TEXT, 
	created_at DATETIME NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_id) REFERENCES products (id)
);
CREATE UNIQUE INDEX ix_search_cache_query_hash ON search_cache (query_hash);
CREATE INDEX ix_products_category_id ON products (category_id);
CREATE INDEX ix_amazon_competitors_product_id ON amazon_competitors (product_id);
CREATE INDEX ix_amazon_competitors_search_session_id ON amazon_competitors (search_session_id);
CREATE INDEX ix_search_sessions_product_id ON search_sessions (product_id);
CREATE INDEX ix_categories_parent_id ON categories (parent_id);
CREATE INDEX ix_review_analyses_product_id ON review_analyses (product_id);
CREATE INDEX ix_amazon_competitors_position ON amazon_competitors (position);
CREATE INDEX ix_products_status_created_at ON products (status, created_at);
COMMIT;
